local function getIcon(name)
    name = string.lower(tostring(name)):match("^%s*(.-)%s*$")
    local find = icons["48px"][name]
    if not find then
        local num = tonumber(name)
        if num then
            return {
                id = num,
                imageRectSize = Vector2.new(48, 48),
                imageRectOffset = Vector2.new(0, 0)
            }
        end
        error(`Lucide-Icons | Failed to find icon by the name of "{name}"`, 2)
    end

    return {
        id = find[1],
        imageRectSize = Vector2.new(find[2][1], find[2][2]),
        imageRectOffset = Vector2.new(find[3][1], find[3][2])
    }
end

local function getAssetUri(id)
    if type(id) == "number" then
        return "rbxassetid://" .. id
    end
    
    warn("Lucide-Icons | The icon argument must be a number (icon ID)")
    return "rbxassetid://0"
end
